class HattRegion(object):
	def __init__(self, *args):
		self.name = args[0]
		self.f = args[1]
		self.l = args[2]
		self.ulx = args[3]
		self.uly = args[4]
		self.urx = args[5]
		self.ury = args[6]
		self.lrx = args[7]
		self.lry = args[8]
		self.llx = args[9]
		self.lly = args[10]
		self.a = args[11:17]
		self.b = args[17:23]

	def contains_egsa_point(self, x, y):
		if (self.urx > x > self.ulx and self.lrx > x > self.llx
				and self.ury > y > self.lry and self.uly > y > self.lly):
			return True
		return False

	def to_egsa(x, y):
	    a = self.a
	    b = self.b
	    ex = a[0] + a[1]*x + a[2]*y + a[3]*(x**2) + a[4]*(y**2) + a[5]*x*y
	    ey = b[0] + b[1]*x + b[2]*y + b[3]*(x**2) + b[4]*(y**2) + b[5]*x*y
	    return ex, ey


